var tipuesearch = {"pages": [{'title': '簡介', 'text': 'CMSimfly ( https://github.com/chiamingyen/cmsimfly)  是一套簡單的網際內容管理系統, 採用 Flask 網際框架, 以 Beautifulsoup 解讀分頁內容. \n', 'tags': '', 'url': '簡介.html'}, {'title': '成員', 'text': '40723122 施東勝 \n 40723130 陳彥旭 \n 40723132 陳乾豐 \n 40723138 黃奕慶 \n 40723148 鄭博鴻 \n 40723149 鄭嘉文', 'tags': '', 'url': '成員.html'}, {'title': 'GAME1', 'text': 'game1 \n The game of craps has the following rules: \n 課本章節:\xa0 https://link.springer.com/chapter/10.1007/978-1-4842-4155-4_2 \xa0 \n The player throws a pair of dice. The sum of the two top faces is what matters so a 1 and a 3 is the same as 2 and 2. The sum of two 6-sided dice can be any number from 2 to 12. If the player throws a 7 or 11 on the first throw, the player wins. If the player throws a 2, 3, or 12, the player loses. For any other result (4, 5, 6, 8, 9, 10), this result is recorded as what is called the player’s point and a follow-up throw is required. On follow-up throws, a throw of 7 loses and a throw of the player’s point wins. For anything else, the game continues with the follow-up throw rules. \n Try it \n \n \n 上述程式原始碼: \n <p><button onclick="myFunction()">Try it</button></p>\n<p id="demo"></p>\n<script>// <![CDATA[\nfunction myFunction() {\n  document.getElementById("demo").innerHTML = Math.floor(Math.random()*10);\n}\n// ]]></script> \n \n  Your browser doesn\'t support the HTML5 element canvas.      Throw dice  \n Stage:   Point:   Outcome:  \n 上述程式原始碼: \n <script type="text/javascript">// <![CDATA[\nvar cwidth = 400;\n\tvar cheight = 300;\n\tvar dicex = 50;\n\tvar dicey = 50;\n\tvar dicewidth = 100;\n\tvar diceheight = 100;\n\tvar dotrad = 6;\n\tvar ctx;\n\tvar dx;\n\tvar dy;\n\tvar firstturn = true;\n\tvar point;\nfunction throwdice() {\n\tvar sum;\n\tvar ch = 1+Math.floor(Math.random()*6);\n\tsum = ch;\n\tdx = dicex;\n\tdy = dicey;\n\tdrawface(ch);\n\tdx = dicex + 150;\n\tch=1 + Math.floor(Math.random()*6);\n\tsum += ch;\n\tdrawface(ch);\n\tif (firstturn) {\n\t\tswitch(sum) {\n\t\t\tcase 7:\n\t\t\tcase 11:\n\t\t\t  document.f.outcome.value="You win!";\n\t\t\t  break;\n\t\t\tcase 2:\n\t\t\tcase 3:\n\t\t\tcase 12:\n\t\t\t  document.f.outcome.value="You lose!";\n\t\t\t  break;\n\t\t\tdefault:\n\t\t\t  point = sum;\n\t\t\t  document.f.pv.value=point;\n\t\t\t  firstturn = false;\n\t\t\t  document.f.stage.value="Need follow-up throw.";\n\t\t\t  document.f.outcome.value="   ";\n\t\t}\n\t}\n\telse {\n\t\tswitch(sum) {\n\t\tcase point:\n\t\t   document.f.outcome.value="You win!";\n\t\t   document.f.stage.value="Back to first throw.";\n\t\t   document.f.pv.value=" ";\n\t\t   firstturn = true;\n\t\t   break;\n\t\tcase 7:\n\t\t   document.f.outcome.value="You lose!";\n\t\t   document.f.stage.value="Back to first throw.";\n\t\t   document.f.pv.value=" ";\n\t\t   firstturn = true;\n\t\t}\n\t\t   \t}\n}\nfunction drawface(n) {\n  ctx = document.getElementById(\'canvas\').getContext(\'2d\');  \n  ctx.lineWidth = 5;\n  ctx.clearRect(dx,dy,dicewidth,diceheight);\n  ctx.strokeRect(dx,dy,dicewidth,diceheight)\n  var dotx;\n  var doty;\n  ctx.fillStyle = "#009966";\n\tswitch(n) {\n\t\tcase 1:\n\t\t draw1();\n\t\t break;\n\t\tcase 2:\n\t\t draw2();\n\t\t break;\n\t\tcase 3:\n\t\t draw2();\n\t\t draw1();\n\t\t break;\n\t\tcase 4:\n\t\t draw4();\n\t\t break;\n\t\tcase 5:\n\t\t draw4();\n\t\t draw1();\n\t\t break;\n\t\tcase 6:\n\t\t draw4();\n\t\t draw2mid();\n\t\t break;\n\t\t\n\t}\n}\nfunction draw1() {\n\tvar dotx;\n\tvar doty;\n\tctx.beginPath();\n\tdotx = dx + .5*dicewidth;\n\tdoty = dy + .5*diceheight;\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tctx.closePath();\n\tctx.fill();\n}\nfunction draw2() {\n\tvar dotx;\n\tvar doty;\n\tctx.beginPath();\n\tdotx = dx + 3*dotrad;\n\tdoty = dy + 3*dotrad;\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tdotx = dx+dicewidth-3*dotrad;\n\tdoty = dy+diceheight-3*dotrad;\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tctx.closePath();\n\tctx.fill();\n}\nfunction draw4() {\n\tvar dotx;\n\tvar doty;\n\tctx.beginPath();\n\tdotx = dx + 3*dotrad;\n\tdoty = dy + 3*dotrad;\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tdotx = dx+dicewidth-3*dotrad;\n\tdoty = dy+diceheight-3*dotrad;\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tctx.closePath();\n\tctx.fill();\n\tctx.beginPath();\n\tdotx = dx + 3*dotrad;\n\tdoty = dy + diceheight-3*dotrad;  //no change\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tdotx = dx+dicewidth-3*dotrad;\n\tdoty = dy+ 3*dotrad;\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tctx.closePath();\n\tctx.fill();\t\n}\nfunction draw2mid() {\n\tvar dotx;\n\tvar doty;\n\tctx.beginPath();\n\tdotx = dx + 3*dotrad;\n\tdoty = dy + .5*diceheight;\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tdotx = dx+dicewidth-3*dotrad;\n\tdoty = dy + .5*diceheight; //no change\n\tctx.arc(dotx,doty,dotrad,0,Math.PI*2,true);\n\tctx.closePath();\n\tctx.fill();\n}\n// ]]></script>\n<p><canvas height="300" id="canvas" width="400"> Your browser doesn\'t support the HTML5 element canvas. </canvas> <br> <button onclick="throwdice();">Throw dice </button></p>\n<form id="f" name="f">Stage: <input name="stage" type="text" value="First Throw"> Point: <input name="pv" type="text" value="   "> Outcome: <input name="outcome" type="text" value="     "></form> \n', 'tags': '', 'url': 'GAME1.html'}]};